#essereFerrari 🔴

@charles_leclerc after #Quali 💬

“Qualifying was really tough for me today. We had an issue throughout the sessions with the electronic management of the engine braking. The situation was particularly problematic in Q1, but for Q3 it had slightly improved and it should be fine for tomorrow. All things considered, eighth is a good result. We will try to gain some positions in Sprint Qualifying to secure a good starting position for Sunday’s race.”

